export const koUtils = {
    isSubscribable: (value) => {
        return typeof value === 'function' && 'subscribe' in value;
    },
    isComputed: (value) => {
        return koUtils.isSubscribable(value) && 'dispose' in value;
    },
    unwrap: (value) => {
        return koUtils.isSubscribable(value) ? value() : value;
    }
};
